import {
    SET_APPOINTMENT_FILTER
} from "../../actions/types";

export const filterAppointments = (startDate='', endDate='') => (dispatch, getState) => {
      dispatch({
        type: SET_APPOINTMENT_FILTER,
        payload: {
            startDate:startDate,
            endDate: endDate
        }
      });
};
